import React from 'react';
import { Form, Button, Row, Col } from 'react-bootstrap';
import { auth, googleProvider, facebookProvider } from '../firebase/config';
import { createUserWithEmailAndPassword, signInWithPopup } from 'firebase/auth';
import '../styles/auth.css';

export default function Register() {
    const handleRegister = async (e) => {
        e.preventDefault();
        const firstName = e.target.firstName.value;
        const lastName = e.target.lastName.value;
        const email = e.target.email.value;
        const password = e.target.password.value;
        const confirmPassword = e.target.confirmPassword.value;

        if (password !== confirmPassword) {
            alert('Passwords do not match');
            return;
        }

        try {
            await createUserWithEmailAndPassword(auth, email, password);
            alert(`Welcome ${firstName}!`);
        } catch (error) {
            alert(error.message);
        }
    };

    const handleGoogleSignUp = async () => {
        try {
            await signInWithPopup(auth, googleProvider);
            alert('Signed up with Google!');
        } catch (error) {
            alert(error.message);
        }
    };

    const handleFacebookSignUp = async () => {
        try {
            await signInWithPopup(auth, facebookProvider);
            alert('Signed up with Facebook!');
        } catch (error) {
            alert(error.message);
        }
    };

    return (
        <div className="auth-container">
            <div className="auth-card">
                <div className="text-center mb-4">
                    <h2>MechObject</h2>
                    <p>Create your account and start shopping</p>
                </div>

                <Form onSubmit={handleRegister} id="registerForm">
                    <Row>
                        <Col md={6} className="mb-3">
                            <Form.Label>First Name</Form.Label>
                            <Form.Control type="text" name="firstName" required />
                        </Col>
                        <Col md={6} className="mb-3">
                            <Form.Label>Last Name</Form.Label>
                            <Form.Control type="text" name="lastName" required />
                        </Col>
                    </Row>
                    <Form.Group className="mb-3">
                        <Form.Label>Email Address</Form.Label>
                        <Form.Control type="email" name="email" required />
                    </Form.Group>
                    <Form.Group className="mb-3">
                        <Form.Label>Password</Form.Label>
                        <Form.Control type="password" name="password" minLength={6} required />
                    </Form.Group>
                    <Form.Group className="mb-3">
                        <Form.Label>Confirm Password</Form.Label>
                        <Form.Control type="password" name="confirmPassword" required />
                    </Form.Group>

                    <Button type="submit" className="btn btn-primary w-100 mb-3">
                        Create Account
                    </Button>
                </Form>

                <div className="text-center mb-3">
                    <p>Or register with:</p>
                    <Button onClick={handleGoogleSignUp} className="btn btn-google me-2" stylt>Google</Button>
                    <Button onClick={handleFacebookSignUp} className="btn btn-facebook">Facebook</Button>
                </div>

                <div className="text-center">
                    <p>Already have an account? <a href="/login" className="text-decoration-none">Login here</a></p>
                    <p><a href="/" className="text-decoration-none">‚Üê Back to Home</a></p>
                </div>
            </div>
        </div>
    );
}
